A weekend of revolutionary politics, debate and entertainment. For more information, see http://www.socialismconference.org

The Corporate and Government Assault On Education Jesse Sharkey Jessie Muldoon Sarah Knopp Socialism 2009 (Chicago) Education
Public school teachers from Chicago, Oakland, and Los Angeles discuss attempts to weaken teachers unions and privatize public schools, and relate efforts to resist these misnamed measures of &quot;school reform.&quot;
